function List({todos, setTodos}) {
  return (
    <div>
        <ul>
            {
                todos.map((todo,i) => (
                    <li key={i}>
                        in
                         {todo.text} 
                    </li>
                ))
            }
            
        </ul>
    </div>
  )
}

